mutation ChatGPT__Chat__CreateOneChatMessage($text: String!, $parentMessageId: String, $chatId: Int!) {
  data: grace_createOneChatMessage(data: {text: $text, parentMessageId: $parentMessageId, History: {connect: {id: $chatId}}}) {
    id
    text
    parentMessageId
    createdAt
    chatId
  }
}

mutation ChatGPT__Chat__CreateOneHistory($title: String!, $userId: String!) {
  data: grace_createOneHistory(data: {title: $title, User: {connect: {id: $userId}}}) {
    id
    title
    createdAt
    updatedAt
  }
}

mutation ChatGPT__Chat__DeleteOneChatMessage($id: Int!) {
  data: grace_deleteOneChatMessage(where: {id: $id}) {
    id
  }
}

mutation ChatGPT__Chat__DeleteOneHistory($id: Int!) {
  data: grace_deleteOneHistory(where: {id: $id}) {
    id
  }
}

query ChatGPT__Chat__GetHistoryList($take: Int = 10, $skip: Int = 0, $orderBy: [grace_HistoryOrderByWithRelationInput], $query: grace_HistoryWhereInput) @internalOperation {
  data: grace_findManyHistory(skip: $skip, take: $take, orderBy: $orderBy, where: {AND: $query}) {
    id
    title
    createdAt
    updatedAt
  }
  total: grace_aggregateHistory(where: {AND: $query}) {
    _count {
      id
    }
  }
}

query ChatGPT__Chat__GetManyChatMessage @internalOperation {
  data: grace_findManyChatMessage {
    id
    text
    parentMessageId
    createdAt
    chatId
  }
}

mutation ChatGPT__Chat__UpdateOneHistory($id: Int!, $title: String) {
  data: grace_updateOneHistory(data: {title: {set: $title}}, where: {id: $id}) {
    id
    title
    createdAt
    updatedAt
  }
}

mutation ChatGPT__Propmt__CreateOnePrompt($prompt: String!, $title: String!, $updatedAt: DateTime!) {
  data: grace_createOnePrompt(data: {prompt: $prompt, title: $title, updatedAt: $updatedAt}) {
    id
    prompt
    title
    createdAt
    updatedAt
  }
}

mutation ChatGPT__Propmt__DeleteOnePrompt($id: Int!) {
  data: grace_deleteOnePrompt(where: {id: $id}) {
    id
  }
}

query ChatGPT__Propmt__GetPromptList($take: Int = 10, $skip: Int = 0, $orderBy: [grace_PromptOrderByWithRelationInput], $query: grace_PromptWhereInput) {
  data: grace_findManyPrompt(skip: $skip, take: $take, orderBy: $orderBy, where: {AND: $query}) {
    id
    prompt
    title
    createdAt
    updatedAt
  }
  total: grace_aggregatePrompt(where: {AND: $query}) {
    _count {
      id
    }
  }
}

mutation ChatGPT__Propmt__UpdateOnePrompt($id: Int!, $prompt: String, $title: String, $updatedAt: DateTime!) {
  data: grace_updateOnePrompt(data: {prompt: {set: $prompt}, title: {set: $title}, updatedAt: {set: $updatedAt}}, where: {id: $id}) {
    id
    prompt
    title
    createdAt
    updatedAt
  }
}

mutation User__CreateOneUser($avatar: String!, $bio: String!, $id: String!, $name: String!, $provider: String = "") @internalOperation {
  data: grace_createOneUser(data: {id: $id, name: $name, avatar: $avatar, bio: $bio, provider: $provider}) {
    id
  }
}

query User__GetOneUser($id: String = "") @internalOperation {
  data: grace_findFirstUser(where: {id: {equals: $id}}) {
    id
    bio
    avatar
    name
  }
}
